import React from 'react';
import './css/HomePage.css';  // Your CSS file
import heroImage from './images/backGround.png';  // Hero background image

function HomePage() {
  return (
    <div className="home-page">
      {/* Flexbox wrapper to control both sections */}
      <div className="page-content">
        {/* Hero Section */}
        <div
          className="hero-section"
          style={{ backgroundImage: `url(${heroImage})` }}
        >
          <div className="hero-overlay">
            <h1>Culinareat</h1>
          </div>
        </div>

        {/* Circle Section */}
        <div className="circle-section">
          <div className="circle" style={{ backgroundColor: '#FFD700' }}></div>
          <div className="circle" style={{ backgroundColor: '#FF6347' }}></div>
          <div className="circle" style={{ backgroundColor: '#4CAF50' }}></div>
          <div className="circle" style={{ backgroundColor: '#1E90FF' }}></div>
          <div className="circle" style={{ backgroundColor: '#FF1493' }}></div>
          {/* Add more circles if needed */}
        </div>
      </div>
    </div>
  );
}

export default HomePage;
